DROP TABLE IF EXISTS "dublinpublicbin" CASCADE;

CREATE TABLE "dublinpublicbin" ( "ogc_fid" SERIAL, CONSTRAINT "dublinpublicbin_pk" PRIMARY KEY ("ogc_fid"), 
"bgeom" geometry DEFAULT st_geomfromtext('point(-24.5 46.7)',4326),
"bin_id" VARCHAR,
"bin_type" VARCHAR,
"electoral_area" VARCHAR,
"latitude" FLOAT8,
"longitude" FLOAT8
);

CREATE INDEX "dublinpublicbin_bgeom_geom_idx" ON "dublinpublicbin" USING GIST ("bgeom");


